import React from "react";
import { Container, Button, colors} from '@mui/material';
import { green } from "@mui/material/colors";


function MainPage () {
    return(
        <Container sx={{  display: 'flex', justifyContent: 'center', alignItems: 'CenterFocusStrong',  height: '100vh', margin: 0}}>
            <h1>какдвда</h1>
            <Button sx={{  display: 'flex'}} variant="contained"  sx={{background: "#4caf50"}}>Contained</Button>
        </Container>
    )
}

export default MainPage;
